import { getUser } from '../utilities/auth';

export default class UserProfile extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            profile: {}
        }
    }
    
    componentDidMount() {
        const profile = getUser();
        if (profile) {
            this.setState({profile});
        }
    }
    render() {
        return (
            <div> 
                <pre> {JSON.stringify(this.state.profile)} </pre> 
            </div>
        )
    }
}
